import React from 'react';

const Menu = () => {
  return (
    <nav className="flex items-center justify-between px-6 py-4 bg-gray-800">
      <div className="flex items-center">
        <img src="logo.png" alt="Logo" className="h-8 w-auto mr-4" />
        <ol className="flex items-center space-x-6 text-white list-none">
          <li><a href="#" className="hover:text-gray-400">Home</a></li>
          <li><a href="#" className="hover:text-gray-400">Events</a></li>
          <li><a href="#" className="hover:text-gray-400">Gallery</a></li>
          <li><a href="#" className="hover:text-gray-400">About</a></li>
          <li><a href="#" className="hover:text-gray-400">Contact</a></li>
        </ol>
      </div>
      <button className="bg-orange-500 hover:bg-orange-600 text-white font-bold py-2 px-4 rounded">Book a Table</button>
    </nav>
  );
};

export default Menu;
